export function add28(a: number, b: number): number {
  return a + b;
}

export function subtract28(a: number, b: number): number {
  return a - b;
}

export function multiply28(a: number, b: number): number {
  return a * b;
}

export function divide28(a: number, b: number): number {
  return a / b;
}
